import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import logo from '../assets/logo.jpg'

const Navbar: React.FC = () => {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        <img src="/logo.jpg" alt="Logo" className="navbar-logo" />
        <span className="navbar-title">Vietnamese Church</span>
      </div>
      <div className="navbar-center">
        <Link to="/" className="navbar-link">Home</Link>
        <Link to="/about" className="navbar-link">About</Link>
        <Link to="/graduates" className="navbar-link">Graduates</Link>
        <Link to="/contact" className="navbar-link">Contact</Link>
      </div>
      <div className="navbar-right">
        <img src="https://i.pravatar.cc/32" alt="Avatar" className="navbar-avatar" />
        <button className="navbar-logout">Logout</button>
      </div>
    </nav>
  );
};

export default Navbar;
